import Logo from "./Components/Logo/Logo"
import TitleForm from "./Components/TitleForm/TitleForm"
import './App.css';
import React from "react";

class App extends React.Component {

  constructor() {
    super ();
    this.state = {
      input: '',
      score: ''
    }

  }


  render(){
    return (
      <div className="App">
          <Logo />
          <TitleForm />
      </div>
    );
  }

};

export default App;
